import React from "react";
import { Layout } from "../components";
import { Container, Row, Col, Form, FormGroup } from "reactstrap";
// import { yupResolver } from "@hookform/resolvers";
import * as yup from "yup";
import { useForm, Controller } from "react-hook-form";
import Select from "react-select";

const carSearchSchema = yup.object().shape({
  title: yup.string().required("*Title is Required"),
  slug: yup.string().required("*Slug is Required"),
  content: yup.string().required("*Content is Required"),
});

const Home = () => {
  const { control, register, handleSubmit, errors } = useForm({
    // resolver: yupResolver(carSearchSchema),
  });
  return (
    <Layout>
      <div className="main-banner">
        <Container>
          <Row className="m-5">
            <Col md={5}>
              <h1 className="home-leftside-title">
                Receive Competing Offers from Your Local Dealers.
              </h1>
              <p className="home-leftside-subtitle">
                We NEVER Share Your Contact Information with ANYONE
              </p>
              <div>
                <video width="100%" controls>
                  <source
                    src="https://youtu.be/SDFUmf8otfc"
                    type="video/mp4"
                  ></source>
                </video>
              </div>
            </Col>
            <Col md={6}>
              <Form className="searchform">
                <Row>
                  <Col md={12}>
                    <h4 className="home-rightside-title">
                      Select Car Preferences
                    </h4>
                  </Col>
                  <Col>
                    <p className="home-rightside-subtitle">
                      * indicates mandatory field.
                    </p>
                  </Col>
                </Row>
                <Row>
                  <Col md={6}>
                    <FormGroup>
                      <Controller
                        as={Select}
                        type="select"
                        name="cartype"
                        control={control}
                        ref={register}
                        placeholder=" Car Type*"
                      />
                    </FormGroup>
                  </Col>
                  <Col md={6}></Col>
                </Row>
              </Form>
            </Col>
          </Row>
        </Container>
      </div>
    </Layout>
  );
};

export default Home;
